import React from "react";
import { Navbar, Nav, Container } from "react-bootstrap";
import { NavLink } from "react-router-dom";
import logo from "../../assets/images/logo.png";
import "./Navbar.css"; // import css riêng

const NavigationBar = () => {
  return (
    <Navbar expand="lg" className="shadow-sm">
      <Container>
        {/* Logo */}
        <Navbar.Brand as={NavLink} to="/">
          <img src={logo} alt="BC Cinema" style={{ height: "72px" }} />
        </Navbar.Brand>

        {/* Menu */}
        <Nav className="navbar-menu fw-bold">
          <Nav.Link as={NavLink} to="/movies">
            PHIM
          </Nav.Link>
          <Nav.Link as={NavLink} to="/food">
            ĐỒ ĂN & THỨC UỐNG
          </Nav.Link>
          <Nav.Link as={NavLink} to="/promotions">
            ƯU ĐÃI & KHUYẾN MÃI
          </Nav.Link>
          <Nav.Link as={NavLink} to="/members">
            THÀNH VIÊN
          </Nav.Link>
        </Nav>
      </Container>
    </Navbar>
  );
};

export default NavigationBar;
